import React from "react";
import "./Projects.css";
import "../imgs/l+f.png";

export default function Projects() {
    return (
        <main>
            <div className="container">
                <h1>Mes projets académiques et personnels</h1>    
                <hr className="long"></hr>
                <h2>Jeux vidéos</h2>    
                <hr className="divider"></hr>
                <div className="grid">
                    <div><img src="l+f.png"></img></div>
                </div>
            </div>
        </main>
    );
}
